import React from 'react';
import PropTypes from 'prop-types';

import AuthNav from "./auth/auth-nav";
import { useAuth0, withAuthenticationRequired } from "@auth0/auth0-react";
import Loading from "./auth/loading";

import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Divider from '@material-ui/core/Divider';
import Drawer from '@material-ui/core/Drawer';
import Hidden from '@material-ui/core/Hidden';
import IconButton from '@material-ui/core/IconButton';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import TableChartIcon from '@material-ui/icons/TableChart';
import MenuIcon from '@material-ui/icons/Menu';
import HomeIcon from '@material-ui/icons/Home'
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import { Switch, Route, Link } from 'react-router-dom'
import Profile from './auth/profile'
import { Dashboard, ViewProgram, GoalInsert, GoalUpdate, ViewSessions, SessionInsert, SessionUpdate } from '../pages'

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  drawer: {
    [theme.breakpoints.up('sm')]: {
      width: drawerWidth,
      flexShrink: 0,
    },
  },
  appBar: {
    [theme.breakpoints.up('sm')]: {
      width: `calc(100% - ${drawerWidth}px)`,
      marginLeft: drawerWidth,
    },
  },
  menuButton: {
    marginRight: theme.spacing(2),
    [theme.breakpoints.up('sm')]: {
      display: 'none',
    },
  },
  // necessary for content to be below app bar
  toolbar: theme.mixins.toolbar,
  drawerPaper: {
    width: drawerWidth,
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
}));

function SideBar(props) {
  const { user } = useAuth0();
  const { name, picture, email } = user;

  const { window } = props;
  const classes = useStyles();
  const theme = useTheme();
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <div>
    <div className={classes.toolbar} />
    <List>
      <ListItem button key="Dashboard">
          <ListItemIcon><HomeIcon /></ListItemIcon>
            <Link to="/">
                <ListItemText primary={"Dashboard"} />
            </Link>
      </ListItem>
      <ListItem button key="Program Block">
          <ListItemIcon><TableChartIcon /></ListItemIcon>
            <Link to="/program">
                <ListItemText primary={"Program Block"} />
            </Link>
      </ListItem>
      <ListItem button key="Sessions">
        <ListItemIcon><TableChartIcon /></ListItemIcon>
        <Link to="/sessions">
          <ListItemText primary={"Sessions"} />
        </Link>
      </ListItem>
        <ListItem button key="Profile">
          <ListItemIcon><TableChartIcon /></ListItemIcon>
            <Link to="/profile">
                <ListItemText primary={"Profile"} />
            </Link>
        </ListItem>
        <ListItem button key="Authenticate">
            <Link to="/login">
              <AuthNav/>
            </Link>
        </ListItem>
    </List>
      <Divider />
    </div>
  );

  const container = window !== undefined ? () => window().document.body : undefined;


  return (
    <div className={classes.root}>
      <CssBaseline />
      <AppBar position="fixed" className={classes.appBar}>
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            className={classes.menuButton}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" noWrap>
            ESDM Therapy Tracker
          </Typography>
        </Toolbar>
      </AppBar>
      <nav className={classes.drawer} aria-label="mailbox folders">
        {/* The implementation can be swapped with js to avoid SEO duplication of links. */}
        <Hidden smUp implementation="css">
          <Drawer
            container={container}
            variant="temporary"
            anchor={theme.direction === 'rtl' ? 'right' : 'left'}
            open={mobileOpen}
            onClose={handleDrawerToggle}
            classes={{
              paper: classes.drawerPaper,
            }}
            ModalProps={{
              keepMounted: true, // Better open performance on mobile.
            }}
          >
            {drawer}
          </Drawer>
        </Hidden>
        <Hidden xsDown implementation="css">
          <Drawer
            classes={{
              paper: classes.drawerPaper,
            }}
            variant="permanent"
            open
          >
            {drawer}
          </Drawer>
        </Hidden>
      </nav>
      <main className={classes.content}>
        <div className={classes.toolbar} />
        <Switch>
          <Route path="/" exact component={Dashboard} />
          <Route path="/program" exact component={ViewProgram} />
          <Route path="/program/create" exact component={GoalInsert} />
          <Route path="/program/update/:id" exact component={GoalUpdate} />
          <Route path="/sessions" exact component={ViewSessions} />
          <Route path="/sessions/create" exact component={SessionInsert} />
          <Route path="/sessions/update/:id" exact component={SessionUpdate} />
          <Route path="/profile" exact component={Profile} />
        </Switch>
      </main>
    </div>
  );
}

SideBar.propTypes = {
  /**
   * Injected by the documentation to work in an iframe.
   * You won't need it on your project.
   */
  window: PropTypes.func,
};

//export default SideBar;

export default withAuthenticationRequired(SideBar, {
  onRedirecting: () => <Loading />,
});
